	function NUI:PlaterImportString()
			StaticPopupDialogs["platerInstall"] = {
				text = "Go to this site for newest import string:",
					button1 = "Ok",
					OnShow = function (self, data)
						self.editBox:SetText("https://wago.io/04bPkFQdw")
						self.editBox:HighlightText()
					end,
					OnAccept = function (self, data, data2)
						local text = self.editBox:GetText()
					end,
					hasEditBox = true,
					timeout = 0,
					whileDead = true,
					hideOnEscape = true,
					preferredIndex = 3,
				}
	
				StaticPopup_Show("platerInstall")
	end
	
	function NUI:DiscordLink()
			StaticPopupDialogs["discordLink"] = {
				text = "Discord link:",
					button1 = "Ok",
					OnShow = function (self, data)
						self.editBox:SetText("https://discord.gg/GWumpwR34C")
						self.editBox:HighlightText()
					end,
					OnAccept = function (self, data, data2)
						local text = self.editBox:GetText()
